import React from 'react';
import Card from "../components/Card";
import {Link} from "react-router-dom"

function Book(props) {
  const {currentUser, book} = props
  return (
    <div key={book.id}>
    {currentUser ? (
      <Link to={`/books/${book.id}`}>
        <Card title={book.title} image={book.image_url} />
      </Link>
    ) : (
      <Card title={book.title} image={book.image_url} />
      )}
  </div>
  );
}

export default Book;
